import React from "react";
import "./NavSocials.css";
const NavSocials = () => {
  return (
    <div className="container">
      <div className="row justify-content-center  navbar">
        <div className="col-xl-2 col-lg-2  col-md-2 col-sm socials">
          <a>SERVICES</a>
        </div>
        <div className="col-xl-2 col-lg-2  col-md-2 col-sm socials">
          <a>PROJECTS</a>
        </div>
        <div className="col-xl-2 col-lg-2  col-md-2 col-sm socials">
          <a>TIMELINE</a>
        </div>
        <div className="col-xl-2 col-lg-2  col-md-2 col-sm socials">
          <a>TEAM</a>
        </div>
        <div className="col-xl-2 col-lg-2  col-md-2 col-sm socials">
          <a>CONTACT</a>
        </div>
      </div>
    </div>
  );
};

export default NavSocials;
